import React from 'react';

import './GamePanel.css';

class GamePanel extends React.Component {

    constructor(props) {

        console.log(props);

        super(props);
        this.state = { sec: props.sec };
        this.changeSec = props.changeSec;
    }

    changeSec(sec) {
        this.setState({ sec: sec });
    }

    render() {
        return (
            <div className="GamePanel">
                <div>колбы: 0</div>
                <div>времечко: { this.state.sec }</div>
                <div>пилюли: 0/20</div>
            </div>
        );
    }
}

export default GamePanel;
